INSERT INTO `activitylogs` (`id`, `uuid`, `role`, `fullname`, `email`, `ip_address`, `user_agent`, `modular`, `module`, `action`, `response`, `activity`, `created_at`, `created_by`) VALUES (28, '388c6878-286a-4c45-a912-b0e373258597', 'Admin', 'Admin', 'admin@gmail.com', '172.16.21.10', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/103.0.0.0 Safari/537.36', 'frontend', 'sambutan', 'edit', '200', '{\"id\": \"1\", \"note\": \"\", \"token\": \"f197ba291e0b38667f7d79c739898a8d99c10aa3\", \"prev_foto\": \"1659587727-1656374436-b612_20220628_163451_277.jpg\", \"nama_kepala\": \"Nasirudin Hidayah, S.HI\", \"kata_sambutan\": \"<div style=\\\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\\\">Assalamualaikum Wr Wb</div><div style=\\\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\\\"><br></div><div style=\\\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\\\">Karakter atau akhlak satu satu yang menjadi impian banyak orang orang tua bahkan mayoritas para orangt tua terhadap anak, karena semuanya mulai sadar bahwa untuk sukses tidak cukup dengan pandai secara akademik, tetapi juga perlu ditopang dengan karakter unggul.&nbsp;</div><div style=\\\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\\\"><br></div><div style=\\\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\\\">SD Muhammadiyah 8 kh mas Mansur memadukan beberapa kecerdasan itu, selain akademik dan al-qur’an menjadi perhatian sekolah itu, juga karakternya menjadi prioritas. Anak tidak cukup membanggakan jika hanya mempunyai nilai akademik yang bagus, tetapi bersama dengan itu harus diikuti dengan akhlak yang baik.</div><div style=\\\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\\\">Beberapa waktu yang lalu, SD Muhammadiyah 8 Kh Mas Mansur Kota Malang mendapatkan penghargaan the best Islamic Character Building, dari upayanya sekolah yang mempunyai komitmen untuk memberikan pelayanan terbaik dan dalam mewujudkan pendidikan karakter bagi peserta didiknya.</div><div style=\\\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\\\"><br></div><div style=\\\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\\\">Dalam hal apa saja? dalam semua sikap dan tindak tanduk anak, sikap berbicara, kata-kata dalam berbicara, melakukan tindakan kepada orang tua, kepada guru dan kepada teman-temannya.&nbsp;</div><div style=\\\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\\\">Anak tidak dibolehkan berkata kasar, berkata dusta, berkata kurang sopan, membantah. Dan itu bukan slogan saja, tetapi sekolah ini benar-benar mengawal dengan baik,&nbsp;</div><div style=\\\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\\\"><br></div><div style=\\\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\\\">Sekolah steril bullying, di sekolah ini beragam latar belakang orang tua, dan beragam karakter, dan juga beragam hoby, namun dari keragaman itu tidak sampai terjadi olok-olok satu dengan yang lain. Anak diajarkan untuk saling menghormati dan menghargai semua bentuk perbedaan yang ada.</div><div style=\\\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\\\"><br></div><div style=\\\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\\\">Wassalamualaikum Wr Wb</div>\"}', '2022-08-04 11:39:23', '388c6878-286a-4c45-a912-b0e373258597');
