h yang mempunyai komitmen untuk memberikan pelayanan terbaik dan dalam mewujudkan pendidikan karakter bagi peserta didiknya.</div><div style=\\\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\\\"><br></div><div style=\\\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\\\">Dalam hal apa saja? dalam semua sikap dan tindak tanduk anak, sikap berbicara, kata-kata dalam berbicara, melakukan tindakan kepada orang tua, kepada guru dan kepada teman-temannya. </div><div style=\\\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\\\">Anak tidak dibolehkan berkata kasar, berkata dusta, berkata kurang sopan, membantah. Dan itu bukan slogan saja, tetapi sekolah ini benar-benar mengawal dengan baik, </div><div style=\\\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\\\"><br></div><div style=\\\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\\\">Sekolah steril bullying, di sekolah ini beragam latar belakang orang tua, dan beragam karakter, dan juga beragam hoby, namun dari keragaman itu tidak sampai terjadi olok-olok satu dengan yang lain. Anak diajarkan untuk saling menghormati dan menghargai semua bentuk perbedaan yang ada.</div><div style=\\\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\\\"><br></div><div style=\\\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\\\">Wassalamualaikum Wr Wb</div>\"}', '2022-08-04 11:40:23', '388c6878-286a-4c45-a912-b0e373258597');
