INSERT INTO `fr_kata_sambutan` (`id`, `foto`, `kata_sambutan`, `nama_kepala`, `note`, `status`, `created_at`, `created_by`, `modified_at`, `modified_by`, `deleted_at`, `deleted_by`, `restored_at`, `restored_by`, `is_deleted`, `is_restored`) VALUES (1, '1671705761-1659588023-1656374023-b612_20220628_162744_998-photoroom.png', '<div style=\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\">Assalamualaikum Wr Wb</div><div style=\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\"><br></div><div style=\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\">Karakter atau akhlak satu satu yang menjadi impian banyak orang orang tua bahkan mayoritas para orangt tua terhadap anak, karena semuanya mulai sadar bahwa untuk sukses tidak cukup dengan pandai secara akademik, tetapi juga perlu ditopang dengan karakter unggul. </div><div style=\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\"><br></div><div style=\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\">SD Muhammadiyah 8 kh mas Mansur memadukan beberapa kecerdasan itu, selain akademik dan al-qur’an menjadi perhatian sekolah itu, juga karakternya menjadi prioritas. Anak tidak cukup membanggakan jika hanya mempunyai nilai akademik yang bagus, tetapi bersama dengan itu harus diikuti dengan akhlak yang baik.</div><div style=\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\">Beberapa waktu yang lalu, SD Muhammadiyah 8 Kh Mas Mansur Kota Malang mendapatkan penghargaan the best Islamic Character Building, dari upayanya sekolah yang mempunyai komitmen untuk memberikan pelayanan terbaik dan dalam mewujudkan pendidikan karakter bagi peserta didiknya.</div><div style=\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\"><br></div><div style=\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\">Dalam hal apa saja? dalam semua sikap dan tindak tanduk anak, sikap berbicara, kata-kata dalam berbicara, melakukan tindakan kepada orang tua, kepada guru dan kepada teman-temannya. </div><div style=\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\">Anak tidak dibolehkan berkata kasar, berkata dusta, berkata kurang sopan, membantah. Dan itu bukan slogan saja, tetapi sekolah ini benar-benar mengawal dengan baik, </div><div style=\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\"><br></div><div style=\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\">Sekolah steril bullying, di sekolah ini beragam latar belakang orang tua, dan beragam karakter, dan juga beragam hoby, namun dari keragaman itu tidak sampai terjadi olok-olok satu dengan yang lain. Anak diajarkan untuk saling menghormati dan menghargai semua bentuk perbedaan yang ada.</div><div style=\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\"><br></div><div style=\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\">Wassalamualaikum Wr Wb</div>', 'Nasirudin Hidayah, S.HI', '', 1, '2022-06-27 12:26:23', 'bb864aad-1b70-49ac-b790-b2025bd33456', '2022-12-22 17:42:41', 'bb864aad-1b70-49ac-b790-b2025bd33456', NULL, NULL, NULL, NULL, 0, 0);
COMMIT;

