INSERT INTO `fr_testimonial` (`id`, `foto`, `testimonial`, `nama`, `note`, `status`, `created_at`, `created_by`, `modified_at`, `modified_by`, `deleted_at`, `deleted_by`, `restored_at`, `restored_by`, `is_deleted`, `is_restored`) VALUES (1, '1656308246-4-(1).jpg', '<p class=\"MsoNormal\">SD Muhammadiyah 8 adalah tempat yang tepat bagi anak-anak kita untuk belajar tidak hanya secara akademis tetapi juga bagaimana menjadi individu yang bertanggung jawab. Aspek yang paling penting adalah anak-anak saya selalu merasa aman dan bahagia setiap hari di sekolah<o></o></p>', 'Sarah Chan', '', 1, '2022-06-27 12:37:26', 'bb864aad-1b70-49ac-b790-b2025bd33456', '2023-01-04 00:46:56', '388c6878-286a-4c45-a912-b0e373258597', NULL, NULL, NULL, NULL, 0, 0);
INSERT INTO `fr_testimonial` (`id`, `foto`, `testimonial`, `nama`, `note`, `status`, `created_at`, `created_by`, `modified_at`, `modified_by`, `deleted_at`, `deleted_by`, `restored_at`, `restored_by`, `is_deleted`, `is_restored`) VALUES (2, '1656308312-2-(1).jpg', '<p><font color=\"#252525\" face=\"Roboto, arial, sans-serif\"><span style=\"font-size: 18px;\">Anak saya telah mengembangkan kecintaannya pada membaca di lingkungan kelas yang sangat mendukung dan membesarkan hati. Dia memiliki hasrat untuk membaca sekarang dan keterampilannya telah berkembang secara dramatis dalam waktu yang singkat</span></font><br></p>', 'Loren Nelson', '', 1, '2022-06-27 12:38:32', 'bb864aad-1b70-49ac-b790-b2025bd33456', '2023-01-04 00:46:04', '388c6878-286a-4c45-a912-b0e373258597', NULL, NULL, NULL, NULL, 0, 0);
INSERT INTO `fr_testimonial` (`id`, `foto`, `testimonial`, `nama`, `note`, `status`, `created_at`, `created_by`, `modified_at`, `modified_by`, `deleted_at`, `deleted_by`, `restored_at`, `restored_by`, `is_deleted`, `is_restored`) VALUES (3, '1656308339-3-(1).jpg', '<p><span xss=removed> remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</span><br></p>', 'Abraham Flik', '', 0, '2022-06-27 12:38:59', 'bb864aad-1b70-49ac-b790-b2025bd33456', NULL, NULL, '2022-12-17 14:26:33', '388c6878-286a-4c45-a912-b0e373258597', NULL, NULL, 1, 0);
INSERT INTO `fr_testimonial` (`id`, `foto`, `testimonial`, `nama`, `note`, `status`, `created_at`, `created_by`, `modified_at`, `modified_by`, `deleted_at`, `deleted_by`, `restored_at`, `restored_by`, `is_deleted`, `is_restored`) VALUES (4, '1656308374-3.jpg', '<p><span xss=removed>Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, f</span><br></p>', 'David Luiz', '', 0, '2022-06-27 12:39:34', 'bb864aad-1b70-49ac-b790-b2025bd33456', NULL, NULL, '2022-12-17 14:26:31', '388c6878-286a-4c45-a912-b0e373258597', NULL, NULL, 1, 0);
INSERT INTO `fr_testimonial` (`id`, `foto`, `testimonial`, `nama`, `note`, `status`, `created_at`, `created_by`, `modified_at`, `modified_by`, `deleted_at`, `deleted_by`, `restored_at`, `restored_by`, `is_deleted`, `is_restored`) VALUES (5, '1656308246-4-(1).jpg', '<p class=\"MsoNormal\">Professional, responsive, and able to keep up with\r\never-changing demand and tight deadlines: That’s how I would describe Jeramy\r\nand his team at The Lorem Ipsum Company. When it comes to content marketing,\r\nyou’ll definitely get the 5-star treatment from the Lorem Ipsum Company.<o></o></p>', 'Frizy Lopsi', '', 0, '2022-06-27 12:37:26', 'bb864aad-1b70-49ac-b790-b2025bd33456', '2022-06-27 12:37:43', 'bb864aad-1b70-49ac-b790-b2025bd33456', '2022-12-17 14:26:28', '388c6878-286a-4c45-a912-b0e373258597', NULL, NULL, 1, 0);
INSERT INTO `fr_testimonial` (`id`, `foto`, `testimonial`, `nama`, `note`, `status`, `created_at`, `created_by`, `modified_at`, `modified_by`, `deleted_at`, `deleted_by`, `restored_at`, `restored_by`, `is_deleted`, `is_restored`) VALUES (6, '1656308312-2-(1).jpg', '<p><span xss=removed> simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic</span><br></p>', 'Sarah Amel', '', 0, '2022-06-27 12:38:32', 'bb864aad-1b70-49ac-b790-b2025bd33456', NULL, NULL, '2022-12-17 14:26:26', '388c6878-286a-4c45-a912-b0e373258597', NULL, NULL, 1, 0);
