INSERT INTO `fr_testimonial` (`id`, `foto`, `testimonial`, `nama`, `note`, `status`, `created_at`, `created_by`, `modified_at`, `modified_by`, `deleted_at`, `deleted_by`, `restored_at`, `restored_by`, `is_deleted`, `is_restored`) VALUES (8, '1659588358-1656374436-b612_20220628_163451_277.jpg', '<p><span style=\"color: rgb(80, 80, 80); font-family: Rubik, sans-serif; font-size: 15px;\">Sekolah steril bullying, di sekolah ini beragam latar belakang orang tua, dan beragam karakter, dan juga beragam hoby, namun dari keragaman itu tidak sampai terjadi olok-olok satu dengan yang lain. Anak diajarkan untuk saling menghormati dan menghargai semua bentuk perbedaan yang ada.</span><br></p>', 'Guru', '', 1, '2022-06-27 12:39:34', 'bb864aad-1b70-49ac-b790-b2025bd33456', '2022-08-04 11:45:58', '388c6878-286a-4c45-a912-b0e373258597', NULL, NULL, NULL, NULL, 0, 0);
